// import fetch from 'isomorphic-unfetch';
import fetch from 'node-fetch'
import { INTRODUCED_BILLS_URL } from '../utils/constants';
import Card from "../components/Card";

const tempData = [
  {
    title:
      "To amend the Public Health Service Act to authorize the expansion of activities related to Alzheimer's disease, cognitive decline, and brain health under the Alzheimer's Disease and Healthy Aging Program, and for other purposes.",
    points: 0,
    sponsor_name: "Brett Guthrie",
    latest_major_action_date: "2017-11-06",
    comments: [],
  },
];

function Index(props) {
  console.log(props.res);
  console.log(props.data);
  return (
    <>
      {tempData.map((card, index) => (
        <Card key={index} {...card} index={index} />
      ))}
    </>
  );
}

async function getServerSideProps() {
  const res = await fetch(INTRODUCED_BILLS_URL, {
    method: 'get',
    // mode: 'cors',
    headers: {
      'Content-Type': 'application/json',
      'X-API-Key': 'PROPUBLICA_API_KEY'
    },
  });
  const data = await res.json()

  console.log(res);
  console.log(data);
  return {
    props: { res, data }
  };
}

export default Index;
